<script>
import WOW from "wow.js";

export default {
  name: "my_profile",
  data() {
    return {
      fromPath: '',
      salary: 3200000,
    }
  },
  beforeRouteEnter(to, from, next) {
    next(vm => {
      console.log(from, 'from')
      vm.fromPath = from.path  //获取上一级路由的路径
      if (
          from.path === '/h5/indexOrderDetail' ||
          from.path === '/h5/storeOrderDetail'
      ) {
        vm.headerRightText = ''
        vm.showDefault = false

        console.log(this.fromPath)
      }
    })
  },
  methods: {
    back: function () {
      if (this.fromPath === '/') this.$router.push('/')
      else this.$router.go(-1)
    },
    commonMoveHandler: function (father, selector, x_dist, y_dist) {
      const apply_method = v => {
        const x = x_dist * v.getAttribute('data-speed')
        const y = y_dist * v.getAttribute('data-speed')
        v.style.transform = v.getAttribute('data-transform') + ` translate(${x}px, ${y}px)`;
        console.log(x, y)
      }
      if (selector.length > 0) this.$refs[father].querySelectorAll(selector).forEach(v => apply_method(v));
      else apply_method(this.$refs[father]);
    },
    moveHandlerPageTwoEmoji: function (e) {
      const c_x = this.$refs.page_two.clientWidth / 2
      const c_y = this.$refs.page_two.clientHeight / 2
      const x_dist = (e.clientX - c_x) / c_x
      const y_dist = (e.clientY - c_y) / c_y
      this.commonMoveHandler('page_two', '.content_decoration', x_dist, y_dist)
    },
    moveHandlerPageTwoAvatar: function (e) {
      console.log(e);
      const c_x = this.$refs.page_two_avatar.clientWidth / 2
      const c_y = this.$refs.page_two_avatar.clientHeight / 2 - 5
      const x_dist = (e.clientX - c_x) / c_x / 3
      const y_dist = (e.clientY - c_y) / c_y
      this.commonMoveHandler('page_two_avatar', '', x_dist, y_dist)
    },
    addSalary: function () {
      this.salary += 100;
    },
    addHair: function () {

    },
    rmBug: function () {

    },
    moneyFormater: function (val) {
      let str = (val / 100).toFixed(2) + '';
      let intSum = str.substring(0, str.indexOf(".")).replace(/\B(?=(?:\d{3})+$)/g, ',');//取到整数部分
      let dot = str.substring(str.length, str.indexOf("."))//取到小数部分搜索
      let ret = intSum + dot;
      return ret
    }
  },
  mounted() {
    let titleToBigger = this.$refs.title_to_bigger;
    titleToBigger.innerHTML = titleToBigger.innerHTML.replace(/吃/g, "<div>$&</div>");
    let i = 1
    titleToBigger.querySelectorAll('div').forEach(
        v => {
          v.style = 'transform: scale(' + i + ')'
          i = i * 1.1
        }
    )

    new WOW(
        {
          live: true
        }
    ).init();

    this.salary = 3200000
  }
}
</script>

